() => {
  // Find the table container
  const tables = document.querySelectorAll('.slidev-layout');

  // Get the card elements
  const cards = document.querySelectorAll('[class*="grid"] > div');

  let result = {
    containerHTML: '',
    cardHTML: [],
    styles: []
  };

  // Get the grid container
  const gridContainer = document.querySelector('[class*="grid"]');
  if (gridContainer) {
    result.containerHTML = gridContainer.outerHTML.substring(0, 500);
    result.containerClasses = gridContainer.className;
    result.containerStyles = window.getComputedStyle(gridContainer).cssText.substring(0, 500);
  }

  // Get individual cards
  cards.forEach((card, index) => {
    if (index < 3) {
      const computedStyle = window.getComputedStyle(card);
      result.cardHTML.push({
        html: card.outerHTML.substring(0, 800),
        classes: card.className,
        backgroundColor: computedStyle.backgroundColor,
        borderRadius: computedStyle.borderRadius,
        padding: computedStyle.padding,
        border: computedStyle.border,
        backdropFilter: computedStyle.backdropFilter
      });
    }
  });

  return result;
}

() => {
  // Find the specific three-column grid with the challenge cards
  const threeColGrid = document.querySelector('.grid.grid-cols-3');

  if (!threeColGrid) return { error: 'Grid not found' };

  const cards = threeColGrid.querySelectorAll(':scope > div');

  let result = {
    gridClasses: threeColGrid.className,
    gridStyles: {},
    cards: []
  };

  const gridStyle = window.getComputedStyle(threeColGrid);
  result.gridStyles = {
    display: gridStyle.display,
    gridTemplateColumns: gridStyle.gridTemplateColumns,
    gap: gridStyle.gap,
    marginTop: gridStyle.marginTop
  };

  cards.forEach((card, index) => {
    const style = window.getComputedStyle(card);
    const header = card.querySelector('div:first-child');
    const items = card.querySelectorAll('div:not(:first-child)');

    result.cards.push({
      classes: card.className,
      styles: {
        background: style.background,
        backgroundColor: style.backgroundColor,
        backdropFilter: style.backdropFilter,
        border: style.border,
        borderRadius: style.borderRadius,
        padding: style.padding
      },
      headerHTML: header ? header.innerHTML : '',
      itemCount: items.length
    });
  });

  return result;
}
